import React, { useState } from 'react';
import { View, Text, StyleSheet } from 'react-native';

function Landing() {
    const [name, setName] = useState('panteras');

    return (<>
        <View style={styles.bold}>
            <Text>Hola {name}!!!!!!</Text>
        </View>
    </>)
}

export default Landing;

const styles = StyleSheet.create({
    bold: {
        fontWeight: 'bold'
    }
})
